function codeToAreaObj(code) {
    let qqq = {};
    areaColdeArr.forEach(function (obj, index) { //
        let result = findKey(obj, code);
        if (result && result == "code") {
            qqq = areaColdeArr[index];
            return;
        } else {
            if (obj.sub) {
                obj.sub.forEach(function (city, index1) { //
                    let result = findKey(city, code);
                    if (result && result == "code") {
                        qqq = obj.sub[index1];
                        return;
                    } else {
                        if (city.sub) {
                            city.sub.forEach(function (county, index2) { //
                                let result = findKey(county, code);
                                if (result && result == "code") {
                                    qqq = city.sub[index2];
                                    return;
                                }
                            });
                        }
                    }
                });
            }
        }
    });
    return qqq;
}